🖤🥷🏻𝔪𝔢𝔱 𝔤𝔞𝔩𝔞🔫💚

inspired by my love for the action heroines that i grew up watching; ripley, trinity, sarah connor, last night i wore a custom, hand-embellished dress, train, corset, and matrix code bodysuit designed and made by the Reuben Selby team in London.

the RS team; Reuben, Hannah, Maewe, Phoebe, and Yang, poured so much of their time and care into making this look and it was so worth it. i felt incredible and i loved every second of it.

thanks also to my cartier family, Akki, Yumi, Honey + nodelato for working with me on the look.

